import React from 'react';
import Header from './Header';
import SideBar from './Sidebar';
import SmallBox from './SmallBox';
import LongBox from './LongBox';
import HorzBox from './HorzBox';
import LargeBox from './LargeBox';
import AssetsBox from './AssetsBox';
import './App.css';

function App() {
  return (
    <div className="app">
      {/* Header */}
      <Header />
      {/* Left SideBar */}
      <SideBar />
      {/* SmallBox - Balance */}
      <SmallBox className="balance"/>
      {/* SmallBox - Bitcoin */}
      <SmallBox className="bitcoin"/>
      {/* SmallBox - Terracoin */}
      <SmallBox className="terracoin"/>
      {/* SmallBox - ZCoin */}
      <SmallBox className="zcoin"/>
      {/* SmallBox - Ethereum */}
      <SmallBox className="ethereum"/>
      {/* LongBox - Recent Operations */}
      <LongBox />
      {/* HorizontalBox - Buy/Sell Coins */}
      <HorzBox />
      {/* LargeBox - Graph (BTC) */}
      <LargeBox />
      {/* LargeBox - Graph (TRC)*/}
      {/* LargeBox - Graph (XZC)*/}
      {/* LargeBox - Graph (ETC)*/}
      {/* SmallBox (Unique Props) - Assets*/}
      <AssetsBox />
    </div>
  );
}

export default App;
